import React from 'react';
import { useNavigate } from 'react-router-dom';

const AdminPanel = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem('adminToken');
    navigate('/admin-login');
  };

  return (
    <div style={{ maxWidth: 400, margin: '60px auto', padding: 24, borderRadius: 12, boxShadow: '0 2px 12px #eee', background: '#fff' }}>
      <h2 style={{ textAlign: 'center', marginBottom: 32 }}>Admin Dashboard</h2>
      <button style={btnStyle} onClick={() => navigate('/admin/create-category')}>Create Category</button>
      <button style={btnStyle} onClick={() => navigate('/admin/add-item')}>Add Item</button>
      <button style={btnStyle} onClick={() => navigate('/admin/search-edit')}>Search/Edit Item</button>
      <button style={{ ...btnStyle, background: '#e74c3c', color: '#fff' }} onClick={handleLogout}>Logout</button>
        <button style={btnStyle} onClick={() => navigate('/admin/manage-contacts')}>Manage Contacts</button>
      <button style={{ ...btnStyle, background: '#e74c3c', color: '#fff' }} onClick={handleLogout}>Logout</button>
    </div>
  );
};

const btnStyle = {
  width: '100%',
  padding: '14px',
  margin: '12px 0',
  border: 'none',
  borderRadius: '6px',
  background: '#222',
  color: '#fff',
  fontSize: '16px',
  cursor: 'pointer',
  fontWeight: 'bold'
};

export default AdminPanel;
